import { useEffect, useState } from 'react';
import './App.css';
import { Routes, Route } from "react-router-dom";
import axios from 'axios';
// import Students from './components/Students';
// import Main from './react-projects-junaid/Classes/Main';
// import ShowTile from './react-projects-junaid/homeproject-2/ShowTitle';
import Posts from './react-projects-junaid/Posts';
import Details from './react-projects-junaid/Classes/Details';


function App() {
  const [value, setValue] = useState(null)
  const getPosts = async () => {
    const response = await axios.get('https://jsonplaceholder.typicode.com/posts')
    const currentval = response.data.slice(0, 5)
    // console.log(currentval);
    setValue(currentval)
  }
  useEffect(()=>{
    getPosts()
  }, [])
  const setData= ()=>{
    setValue(['a','b'])
  }
  return (
    <div className="App">
      {/* <Students/> */}
      {/* <Main/>   */}
      {/* <ShowTile/> */}
      <button onClick={setData}>click</button>
      <Routes>
        <Route path='posts' element={<Posts data={value} />}/>
        <Route path='posts/:i' element={<Details data={{}} />}/>

      </Routes>


    </div>
  );
}

export default App;
